import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './page/Header';
import Footer from './page/Footer';

import MainPage from './page/mainPage/MainPage';

function App() {

  return (

  <BrowserRouter>
   <Header />
      <Routes>

         <Route path="/" element={<MainPage />}/>
      </Routes> 
      <Routes>

         <Route path="/" element={<MainPage />}/>
      </Routes> 
    <Footer />
  </BrowserRouter>

  );
}

export default App;
